<h1 class="Section4">
<a class="Section5" href="#" id="ecriture-de-donnees-textuelles-dans-un-fichier">Ecriture de données textuelles dans un fichier</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Ecriture de données textuelles dans un fichier:<br>&nbsp;<br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GWindow::on_actionOpen_triggered(bool checked) {
    QFile lFile("data.txt");
    if (lFile.open(QIODevice::WriteOnly | QIODevice::Text | QIODevice::Truncate)) {
        QTextStream lOutput(&amp;lFile);
        for(int i = 0; i &lt; 5; i++) {
            for(int j = 0; j &lt; 10; j++) {
                lOutput &lt;&lt; (i + j + i*j) &lt;&lt; " ";
            }
            lOutput &lt;&lt; "\n";
        }
        lFile.close();
    }
}
//===============================================</pre><br></div>
</div>
</div>
