<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="listing-des-ports-series-disponibles--qtablewidget-">Listing des ports séries disponibles (QTableWidget)</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Listing des ports séries disponibles (QTableWidget):<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
GPortDialog::GPortDialog(QWidget *parent)
: QDialog(parent)
, ui(new Ui::GPortDialog) {
    ui-&gt;setupUi(this);

    QList&lt;QSerialPortInfo&gt; lPorts = QSerialPortInfo::availablePorts();
    ui-&gt;tableWidget-&gt;setRowCount(lPorts.size());
    ui-&gt;tableWidget-&gt;setEditTriggers(QAbstractItemView::NoEditTriggers);
    ui-&gt;tableWidget-&gt;setSelectionBehavior(QAbstractItemView::SelectRows);


    for (int i = 0; i &lt; lPorts.size(); i++) {
        QTableWidgetItem* lNewItem;
        QSerialPortInfo lPort = lPorts.at(i);

        // portName
        lNewItem = new QTableWidgetItem(lPort.portName());
        ui-&gt;tableWidget-&gt;setItem(i, 0, lNewItem);
        // description
        lNewItem = new QTableWidgetItem(lPort.description());
        ui-&gt;tableWidget-&gt;setItem(i, 1, lNewItem);
        // manufacturer
        lNewItem = new QTableWidgetItem(lPort.manufacturer());
        ui-&gt;tableWidget-&gt;setItem(i, 2, lNewItem);
        // productIdentifier
        lNewItem = new QTableWidgetItem(QString::number(lPort.productIdentifier()));
        ui-&gt;tableWidget-&gt;setItem(i, 3, lNewItem);
        // vendorIdentifier
        lNewItem = new QTableWidgetItem(QString::number(lPort.vendorIdentifier()));
        ui-&gt;tableWidget-&gt;setItem(i, 4, lNewItem);
        // serialNumber
        lNewItem = new QTableWidgetItem(lPort.serialNumber());
        ui-&gt;tableWidget-&gt;setItem(i, 5, lNewItem);
    }

    ui-&gt;tableWidget-&gt;horizontalHeader()-&gt;setSectionResizeMode(QHeaderView::ResizeToContents);
    ui-&gt;tableWidget-&gt;horizontalHeader()-&gt;setStretchLastSection(true);

    if(lPorts.size() &gt; 0) {
        ui-&gt;tableWidget-&gt;selectRow(0);
    }
}
//===============================================</pre><br>Gestion du double-clic sur un port série:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GPortDialog::on_tableWidget_cellDoubleClicked(int row, int column) {
    accept();
}
//===============================================</pre><br>Sélection d'un port série:&nbsp;<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GPortDialog::accept() {
    int row = ui-&gt;tableWidget-&gt;currentRow();
    if(row != -1) {
        m_portName = ui-&gt;tableWidget-&gt;item(row, 0)-&gt;text();
    }
    QDialog::accept();
    qDebug() &lt;&lt; m_portName;
}
//===============================================</pre><br>Lecture du nom du port série:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
const QString&amp; GPortDialog::getPortName() const {
    return m_portName;
}
//===============================================</pre><br></div>
</div>
</div>
